(function ( $ ) {
	'use strict';

	$.fn.ftAlert = function( options ) {

		var settings = $.extend({

			text: 'Üzgünüm! Bir hata oluştu.',
			cssClass: 'loading',
			close: false

		}, options);

		var theme = $('<div />').addClass('ftAlert').addClass( settings.cssClass );
		$('<div>' + settings.text + '</div>').appendTo( theme );
		if (settings.close) $('<a href="#" class="close">&times;</a>').prependTo( theme );

		this.find('.ftAlert').remove();
		this.append( theme );

		this.on('click', '.close', function( e ) {
			$(this).closest('.ftAlert').remove();
		});

		return;
	};

})(jQuery);



